import { Outlet, Link } from "react-router-dom";
import Login from "../Login";
import "./styles.css";

const Layout = () => {
  return (
    <>
      <nav className="nav">
        <div>
            <Link to="/">Home</Link>
        </div>
        <div>
            <Link to="/blogs">Blogs</Link>
        </div>
        <div>
            <Link to="/contact">Contact</Link>
        </div>
        
        <div className="glogin"><Login/></div>

      </nav>

      <Outlet />
    </>
  )
};

export default Layout
